class Solution {
    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function maximumSum($nums) {
        $group = [];
        foreach ($nums as $num) {
            $sqrt = sqrt($num);
            $key = 1;
            for ($i = 2; $i <= $sqrt; $i++) {
                if ($num % $i == 0) {
                    $count = 0;
                    while ($num % $i == 0) {
                        $num /= $i;
                        $count++;
                    }
                    if ($count % 2 == 1) {
                        $key *= $i;
                    }
                }
            }
            if ($num > 1) {
                $key *= $num;
            }
            if (!isset($group[$key])) {
                $group[$key] = 0;
            }
            $group[$key] += $key;
        }
        return max($group);
    }
}
